import CustomButton from "./CustomButton";

function List(props) {
  return (
    <div className="square-style">
      {props.list.title}
      {props.list.desc}
      <CustomButton
        color="red"
        onClick={() => {
          props.handleDelete(props.list.id);
        }}
      >
        삭제하기
      </CustomButton>
      <CustomButton
        color="red"
        onClick={() => {
          props.handleDone(props.donelist.id);
        }}
      >
        완료
      </CustomButton>
    </div>
  );
}

function DoneList(props) {
  return (
    <div className="square-style">
      {props.donelist.title}
      {props.donelist.desc}
      <CustomButton
        color="red"
        onClick={() => {
          props.handleDelete(props.donelist.id);
        }}
      >
        삭제하기
      </CustomButton>
      <CustomButton
        color="red"
        onClick={() => {
          props.handleDone(props.donelist.id);
        }}
      >
        완료
      </CustomButton>
    </div>
  );
}

export { List };
export { DoneList };
